import React from "react";

function Users() {
  return (
    <div className="container" style={{ textAlign: "center" }}>
      <div className="" style={{ fontSize: "30px" }}>
        WE
      </div>
      <div className="" style={{ fontSize: "30px" }}>
        LOVE
      </div>
      <div className="" style={{ fontSize: "30px" }}>
        Our Scouts
      </div>
    </div>
  );
}

export default Users;
